CREATE TABLE artist(
  artist_id    INTEGER  NOT NULL PRIMARY KEY,
  full_name    VARCHAR(29) NOT NULL,
  first_name   VARCHAR(12) NOT NULL,
  middle_names VARCHAR(16),
  last_name    VARCHAR(20) NOT NULL,
  nationality  VARCHAR(9) NOT NULL,
  style        VARCHAR(20) NOT NULL,
  birth        INTEGER  NOT NULL,
  death        INTEGER  NOT NULL
);

CREATE TABLE museum(
  museum_id INTEGER  NOT NULL PRIMARY KEY,
  name      VARCHAR(50) NOT NULL,
  address   VARCHAR(31) NOT NULL,
  city      VARCHAR(20) NOT NULL,
  state     VARCHAR(15),
  postal    VARCHAR(9),
  country   VARCHAR(14) NOT NULL,
  phone     VARCHAR(20) NOT NULL,
  url       VARCHAR(61) NOT NULL
);

CREATE TABLE work(
  work_id   INTEGER  NOT NULL,
  name      VARCHAR(115) NOT NULL,
  artist_id INTEGER  NOT NULL,
  style     VARCHAR(18),
  museum_id INTEGER,
  CONSTRAINT work_artist_fk FOREIGN KEY (artist_id) REFERENCES artist(artist_id),
  CONSTRAINT work_museum_fk FOREIGN KEY (museum_id) REFERENCES museum(museum_id)
);












